#include <stdio.h>

int main() {
    int i, j, k;
    long long int maiorProduto = 0, produtoAtual = 1;

    char sequencia[] = "";

    for (i = 0; i < 996; i++) 
    {
        produtoAtual = 1;
        for (j = i; j < i + 5; j++) 
        {
            k = sequencia[j] - '0';
            produtoAtual *= k;
        }
        if (produtoAtual > maiorProduto) 
        {
            maiorProduto = produtoAtual;
        }
    }

    printf("O maior produto de cinco digitos consecutivos na sequencia eh: %lld\n", maiorProduto);

    return 0;
}
